  MDBContainer,
} from "mdbreact";

import { BrowserRouter as Router, Link } from "react-router-dom";
const style = {
  width: "200px",
};
export default function Card({
  transaction: {
    date,
    title,
    image,
    description,
    amount,
    type,
    account,
    role,
    url,
  },
}) {
  return (
    <div>
	<h3>{account}</h3>
      <Link to={url}>
        <div className="row">
          <div className="col">
            {" "}
            <img style={style} src={image} />
          </div>
        </div>
      </Link>
    </div>
  );
}
